.box7 {
    width: 140px;
    height: auto;
    float: left;
    position: relative;
    display: block;
    overflow: hidden;
    padding: 15px;
    text-align: center;
    margin: 0 5px;
    font-weight: 700;
    background: transparent;
    text-transform: uppercase;
    border-radius: 30px;
    color: black;
}

.box7:before {
    position: absolute;
    content: '';
    left: 0;
    bottom: 0;
    height: 4px;
    width: 100%;
    border-bottom: 4px solid transparent;
    border-left: 4px solid transparent;
    box-sizing: border-box;
    transform: translateY(100%);
}

.box7:after {
    position: absolute;
    content: '';
    top: 0;
    left: 0;
    width: 100%;
    height: 4px;
    border-top: 4px solid transparent;
    border-right: 4px solid transparent;
    box-sizing: border-box;
    transform: translateY(-100%);
}

.box7:hover {
    box-shadow: 0 5px 15px rgba(0, 0, 0, 0.5);
    transition: box-shadow 0.5s ease;
}

.box7:not(:hover) {
    box-shadow: none;
    transition: box-shadow 0.5s ease;
}

.box7:hover:before,
.box7:hover:after {
    height: 100%;
    transform: translateY(0);
}

