    background-color: rgba(255, 255, 255, 0.5);
    z-index: 1;
}

.snowball-button9:hover {
    transform: scale(1.1);
    box-shadow: 0 8px 20px rgba(0, 123, 255, 0.5);
    animation: shake 0.5s linear infinite;
}

.snowball-button9 .icon {
    font-size: 36px;
